sys_hub_input_scripts.script:
{"counter":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
return --fd_data.flow_var.counter;"}}

{"terraform_api_base_url":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
return (new sn_cloud_acct_mgt.CAMUtilityFunctions()).getTerraformAPIBaseURL(fd_data.subflow_inputs.sa_request_record.cam_app_config.tfe_url);"}}

